import React from 'react';
import './taskOwner.css';

const taskOwner = (props) => {
    return (
        <div className="taskOwner">
            <label>
                first Name:
            </label> 
            <input 
                type="text" 
                value = {props.fname} 
                onChange = {props.change}
            />
            <label>last Name:</label> <input type="text" value = {props.lname} />
            <label> Task:</label> <textarea value = {props.task} />
        </div>
    );
};

export default taskOwner;
